import React, { useState, useEffect } from 'react';

function App() {
  const [produse, setProduse] = useState([]);
  const [filters, setFilters] = useState({
    denumire: '',
    substanta: '',
    categorie: '',
    cultura: '',
    daunator: '',
  });
  const [error, setError] = useState(null);
console.log("ðŸš€ Query:", params.toString());
  const fetchProduse = async () => {
    try {
      const params = new URLSearchParams();
      Object.entries(filters).forEach(([key, value]) => {
        if (value) params.append(key, value);
      });
      const res = await fetch(`/produse/cautare?${params.toString()}`);
      if (!res.ok) throw new Error('Error fetching');
      const data = await res.json();
      setProduse(data);
    } catch {
      setError('Failed to fetch');
    }
  };

  useEffect(() => {
    fetchProduse();
  }, []);

  const handleFilterChange = (e) => {
    setFilters(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleSearch = () => {
    fetchProduse();
  };

  return (
    <div className="app">
      <header>
        <img src="/logo.png" alt="Rodbun Logo" className="logo" />
        <h1>Produse Fitosanitare</h1>
      </header>
      <div className="filters">
        <input name="denumire" placeholder="Denumire" value={filters.denumire} onChange={handleFilterChange} />
        <input name="substanta" placeholder="SubstanÈ›Äƒ" value={filters.substanta} onChange={handleFilterChange} />
        <input name="categorie" placeholder="Categorie" value={filters.categorie} onChange={handleFilterChange} />
        <input name="cultura" placeholder="CulturÄƒ" value={filters.cultura} onChange={handleFilterChange} />
        <input name="daunator" placeholder="DÄƒunÄƒtor" value={filters.daunator} onChange={handleFilterChange} />
        <button onClick={handleSearch}>CautÄƒ</button>
      </div>
      {error && <div className="error">{error}</div>}
      <table>
        <thead>
          <tr>
            <th>Denumire</th>
            <th>SubstanÈ›e active</th>
            <th>Categorie</th>
            <th>Culturi</th>
            <th>DÄƒunÄƒtori</th>
          </tr>
        </thead>
        <tbody>
          {produse.map((p, i) => (
            <tr key={i}>
              <td>{p.denumire_produs}</td>
              <td>{[p.substanta_activa_1, p.substanta_activa_2, p.substanta_activa_3, p.substanta_activa_4].filter(Boolean).join(', ')}</td>
              <td>{p.categorie_produs}</td>
              <td>{p.culturi_omologate}</td>
              <td>{p.daunatori_omologati}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
